import React from 'react';

import './assets/css/GoDown.css';

const GoDown = (props) => {
    return ( 
        <a href="#bottom" className="GoDown">
            <div>
                <i className="arrow down"></i>
            </div>
        </a>
     );
}

export default GoDown;
